function createExcel(data) {
    const ws = wb.addWorksheet('Artist')
    ws.cell(1, 1).string('id')
    ws.cell(1, 2).string('songId')
    ws.cell(1, 3).string('name')
    ws.cell(1, 4).string('albumId')
    ws.cell(1, 5).string('artistId')
    ws.cell(1, 6).string('url')
    ws.cell(1, 7).string('link')

    data.forEach((artist, index) => {
        ws.cell(index + 2, 1).string(artist.id)
        ws.cell(index + 2, 2).string(artist.songId)
        ws.cell(index + 2, 3).string(artist.name)
        ws.cell(index + 2, 4).string(artist.albumId)
        ws.cell(index + 2, 5).string(artist.artistId)
        ws.cell(index + 2, 6).string(artist.url)
        ws.cell(index + 2, 7).string(artist.link)
    })

    wb.write('api_excel.xlsx')
}

